using BloomFilter.HashAlgorithms.Internal;
using System;
using System.Buffers.Binary;
using System.Collections.Generic;
using Xunit;

namespace BloomFilterTest.HashAlgorithms
{
    public class Murmur3Test
    {
        [Fact]
        public void Murmur32BitsX86_Hash()
        {
            var tests = Murmur32BitsX86TestData();

            foreach (var test in tests)
            {
                var hash = Murmur32BitsX86.HashToUInt32(test.Hex.FromHex(), test.Seed);

                Assert.Equal(BitConverter.ToUInt32(test.Hash.FromHex()), hash);
            }
        }

        [Fact]
        public void Murmur32BitsX86_Append()
        {
            var tests = Murmur32BitsX86TestData();

            foreach (var test in tests)
            {
                var murmurHash32 = new Murmur32BitsX86(test.Seed);

                Span<byte> span = test.Hex.FromHex();

                while (span.Length > 0)
                {
                    var n = Random.Shared.Next(1, span.Length);
                    var d = span.Slice(0, n);
                    murmurHash32.Append(d);
                    span = span.Slice(n);
                }

                var hash2 = murmurHash32.GetCurrentHashAsUInt32();

                Assert.Equal(BitConverter.ToUInt32(test.Hash.FromHex()), hash2);


            }
        }


        [Fact]
        public void MurMurHash128X64()
        {
            var tests = Murmur128BitsX64TestData();

            foreach (var test in tests)
            {
                var hash = Murmur128BitsX64.HashToUInt128Array(test.Hex.FromHex(), test.Seed);

                var data = new byte[16];
                var destination = data.AsSpan();

                BinaryPrimitives.WriteUInt64LittleEndian(destination, hash[0]);
                BinaryPrimitives.WriteUInt64LittleEndian(destination.Slice(sizeof(ulong)), hash[1]);

                Assert.Equal(test.Hash, Convert.ToHexString(destination));
            }
        }

